// GetBindInfo 检查用户绑定信息接口
func GetBindInfo(c *gin.Context) {
	var service service.GetBindInfoService
	if err := c.ShouldBind(&service); err == nil {
		res := service.GetBindInfo(c)
		if res.Data != nil {
			c.JSON(200, res.Data)
		} else {
			c.JSON(200, res)
		}
	} else {
		c.JSON(200, ErrorResponse(err))
	}
}

